sys_variable_value.value:
(function execute(inputs, outputs){
  try {
    var pLabel;
    var gl = new global.GSLog("sn_vul.usb.logging.verbosity", "DataTheorem_Dwnload");
    var impDATA = new GlideRecord("scheduled_import_set");

    outputs.load_status =  true; 

    impDATA.addQuery("sys_id", "ee08a3621b4fa8d8c4311f49b04bcbcb"); 
    impDATA.query();

    if (impDATA.next()) {
              gs.executeNow(impDATA); 
    }
    gs.info('[usb-vul-dto] - Scheduled Data Import ' + outputs.load_status);
  } 
  catch(ex) {
    outputs.load_status = false;
    gl.logInfo(gs.getMessage('sn_vul', "====> FlowDesigner Download Error <=== " + ex));
  }      
}
)(inputs, outputs);

